objeto:
Elaboração de Projeto de Engenharia e Projetos Complementares (sondagem, geotécnico e estrutural) de 10 (dez) barragens de contenção de produtos perigosos, para implantação nos seguintes locais, sendo 2 (duas) barragens por localidade:
1)	Curitiba, BR-116 próximo à ponte do Rio Timbu;
2)	Cascavel, BR-277 próximo à ponte do Rio Cascavel;
3)	Castro, PR-151, próximo ao Rio São Cristóvão;
4)	Ortigueira, BR-376, próximo ao Km 350;
Mauá da Serra, BR-376, próximo aos Km 304 e 307. Em Mauá da Serra o projeto deverá contemplar apenas uma barragem de contenção em cada ponto.
